import React from "react";

const FilterPrice = () => {
  const radios = [
    {
      id: 1,
      name: "$0-$100",
    },
    {
      id: 2,
      name: "$100-$500",
    },
    {
      id: 3,
      name: "$500-$1000",
    },
  ];

  return (
    <>
      {radios?.map((radio) => (
        <input type="radio" name="price" id={radio.id} key={radio.id}>
          {radio.name}
        </input>
      ))}
    </>
  );
};

export default FilterPrice;
